import React from 'react';
import {Formik, Form, Field} from 'formik';


function AddIngredient() {

  return ( 
    <div className="addIngredientPage">
      <Formik >
        <Form>
            <label>Ingredient Name: </label>
            <Field id="inputAddIngredient" name="name" placeholder="Example: Salt" />
            <label>Category: </label>
            <Field id="inputAddIngredient" name="category" placeholder="Example: meat/dairy" />
            <label>Portion Type: </label>
            <Field id="inputAddIngredient" name="portion" placeholder="Example: 100g/teaspoon" />
            <label>Calories no.: </label>
            <Field id="inputAddIngredient" name="caloriesPerPortion" placeholder="Example: 15" />
        </Form>
       </Formik>
    </div>
  );
}

export default AddIngredient;
